le-info muted"> <dt class=article-info-term> Details </dt><dd class=createdby itemprop=author itemscope itemtype=https://schema.org/Person> Written by <span itemprop=name>Super User</span> </dd><dd class=category-name> Category: <a href=/production-rates/92-production-rates/foundation/sheet-piling itemprop=genre>Sheet Piling</a> </dd><dd class=published> <span class=icon-calendar></span> <time datetime=2012-08-01T08:56:06+00:00 itemprop=datePublished> Published: August 01, 2012 </time> </dd><dd class=hits> <span class=icon-eye-open></span> <meta itemprop=interactionCount content=UserPageVisits:6833 />Hits: 6833 </dd></dl><div itemprop=articleBody><h4><strong>Sheet Piling On reclamation, sand fill, sheet piling by crane and drop hammer, vibro hammer or diesel hammer.</strong></h4><ul> <li>A rate of 20 - 25 No/day to 20 to 35 m deep.</li> <li>1 no = 0.4 m wide on plan and 6 m long.</li> <li>Therefore 8 - 10 m/day per rig is achievable.</li> </ul><p>&nbsp;</p><h4><strong>On more difficult areas, such as through existing ground or a sea wall for example.</strong></h4><ul> <li>A rate of 10 - 12 No/day to 20 m deep.</li> <li>Therefore 4 - 6 m/day per rig is achievable.</li> </ul><p>For more shallow sheet pile walls</p><ul> <li>Driven by - Pilemaster 60.0 m/day</li> <li>Driven by - Automatic Drop Hammer 32.0 m/day</li> </ul><p>Steel for piles is usually readily available and a two week lead in is often all that is required.</p><p>&nbsp;</p><p><strong>Sheet Piling</strong></p><table border=1 class=telerik-reTable-4 style="border-width: 1px; border-style: solid; border-collapse: collapse; font-family: Tahoma; width: 100%; height: 130px;" cellspacing=0 cellpadding=0> <tbody> <tr class=telerik-reTableHeaderRow-4 style="border-width: 1pt 1pt 3pt; margin: 0in 0in 10pt; line-height: 17px; font-size: 11pt; font-family: Calibri, sans-serif; width: 119.7pt; background-color: #4f81bd; padding: 0in 5.4pt; color: #ffffff;"> <td class=telerik-reTableHeaderFirstCol-4 style="padding: 0in 